package net.minecraft.src;import modchu.lib.characteristic.Modchu_AS;import modchu.lib.characteristic.Modchu_ModelRenderer;import modchu.model.ModchuModel_IModelCaps;import modchu.model.ModchuModel_ModelCapsHelper;import modchu.model.multimodel.MultiModelSkirtFloats;public class MultiModel_Biped64 extends MultiModel_Biped {	public Modchu_ModelRenderer bipedJacket;	public Modchu_ModelRenderer bipedRightSleeve;	public Modchu_ModelRenderer bipedLeftSleeve;	public Modchu_ModelRenderer bipedRightPants;	public Modchu_ModelRenderer bipedLeftPants;	public MultiModel_Biped64() {		this(0.0F);	}	public MultiModel_Biped64(float f) {		this(f, 0.0F);	}	public MultiModel_Biped64(float f, float f1) {		this(f, f1, 64, f == 0.0F ? 64 : 32);	}	public MultiModel_Biped64(float f, float f1, int i, int j) {		super(f, f1, i, j);	}	@Override	public void initModel(float f, float f1) {		initModel(f, f1, true);	}	public void initModel(float f, float f1, boolean isAfterInit) {		super.initModel(f, f1, false);		if (f == 0.0F) {			bipedJacket = new Modchu_ModelRenderer(this, 16, 32);			bipedJacket.addBox(-4.0F, 0.0F, -2.0F, 8, 12, 4, f + 0.5F);			bipedRightSleeve = new Modchu_ModelRenderer(this, 40, 32);			bipedRightSleeve.addBox(-2.0F, 0.0F, -2.0F, 4, 12, 4, f + 0.5F);			bipedLeftSleeve = new Modchu_ModelRenderer(this, 48, 48);			bipedLeftSleeve.addBox(-2.0F, 0.0F, -2.0F, 4, 12, 4, f + 0.5F);			bipedRightPants = new Modchu_ModelRenderer(this, 0, 32);			bipedRightPants.addBox(-2.0F, 0.0F, -2.0F, 4, 12, 4, f + 0.5F);			bipedLeftPants = new Modchu_ModelRenderer(this, 0, 48);			bipedLeftPants.addBox(-2.0F, 0.0F, -2.0F, 4, 12, 4, f + 0.5F);		}		if (isAfterInit) afterInit(f, f1);	}	public void defaultAddChildSetting() {		super.defaultAddChildSetting();		if (bipedBody != null) {			if (bipedJacket != null) bipedBody.addChild(bipedJacket);		}		if (bipedRightSleeve != null) bipedRightArm.addChild(bipedRightSleeve);		if (bipedLeftSleeve != null) bipedLeftArm.addChild(bipedLeftSleeve);		if (bipedRightPants != null) bipedRightLeg.addChild(bipedRightPants);		if (bipedLeftPants != null) bipedLeftLeg.addChild(bipedLeftPants);	}	@Override	public void defaultPartsSettingBefore(ModchuModel_IModelCaps entityCaps) {		String[] s = {				"rightArm", "rightArm2", "rightArmPlus", "rightArmPlus2", "rightHand",				"rightLeg", "rightLeg2", "rightLegPlus", "rightLegPlus2", "leftArm",				"leftArm2", "leftArmPlus", "leftArmPlus2", "leftHand", "leftLeg",				"leftLeg2", "leftLegPlus", "leftLegPlus2", "HeadMount", "mainFrame"		};		setCapsValue(entityCaps, caps_showPartsHideList, (Object) s);		String[] s1 = {				"bipedHead", "bipedHeadwear", "bipedBody", "bipedRightArm", "bipedLeftArm",				"bipedRightLeg", "bipedLeftLeg", "bipedJacket", "bipedRightSleeve", "bipedLeftSleeve",				"bipedRightPants", "bipedLeftPants", "c", "d", "e",				"f", "g", "h", "i", "j",				"k", "field_78116_c", "field_78114_d", "field_78115_e", "field_78112_f",				"field_78113_g", "field_78123_h", "field_78124_i", "field_78121_j", "field_78122_k"		};		String[] s2 = {				"Head", "Headwear", "Body", "RightArm", "LeftArm",				"RightLeg", "LeftLeg", "Jacket", "RightSleeve", "LeftSleeve",				"RightPants", "LeftPants", "Head", "Headwear", "Body",				"RightArm", "LeftArm", "RightLeg", "LeftLeg", "bipedCloak",				"bipedEars", "bipedHead", "Headwear", "Body", "RightArm",				"LeftArm", "RightLeg", "LeftLeg", "bipedEars", "bipedCloak"		};		setCapsValue(entityCaps, caps_showPartsRenemeMap, s1, s2);	}}